def plot_ecg():
    global ecg_signal
    global window
    global plot
    global canvas
    global anim
    matplotlib.use('TkAgg')
    fig = Figure(figsize = (8,4), dpi = 100)
    t = []
    x = []
    plot = fig.add_subplot(111)
    line, = plot.plot([], [], color='red')
    plot.set_xlabel("Time [s]")
    plot.set_ylabel("Voltage [V]")
    plot.set_xlim([0,3])
    plot.set_ylim([1,3])

    canvas = FigureCanvasTkAgg(fig, master = window)
    canvas.draw()
    canvas.get_tk_widget().place(x=0,y=50)
    global curr
    curr = 0
    def init():
        line.set_data([],[])
        return line,
    def animate(j):
        global curr
        global ecg_signal
        #x = numpy.linspace(0, 2, 1000)
        #y = numpy.sin(2 * numpy.pi * (x - 0.01 * i))+2
        i = curr
        t.append((i-1)/128)
        x.append(ecg_signal[i])
        line.set_data(t, x)
        curr = curr + 1
        return line,
    anim = animation.FuncAnimation(fig, animate, init_func = init, frames = 20, interval = 20, blit = True)


